import React, {useState, useEffect} from 'react';
import bridge from '@vkontakte/vk-bridge';
import {View, ScreenSpinner, AdaptivityProvider, AppRoot, ConfigProvider, SplitLayout, SplitCol} from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

import Home from './panels/Home';

import MyEvent from "./panels/MyEvent";

const App = () => {
    const [activePanel, setActivePanel] = useState('home');
    const [fetchedUser, setUser] = useState(null);
    const [popout, setPopout] = useState();

    useEffect(() => {
        // Получаем значения переменных из хранилища
        bridge.send('VKWebAppStorageGet', {
            keys: ['userViewedSlides']
        })
            .then((storageData) => {
                if (storageData.keys) {
                    // Проверяем, просматривал ли пользователь слайды ранее
                    const userViewedSlides = storageData.keys.find(item => item.key === 'userViewedSlides');

                    // Вызываем VKWebAppShowSlidesSheet только если пользователь еще не просматривал слайды
                    if (!userViewedSlides || userViewedSlides.value !== 'true') {
                        // Показываем слайды
        bridge.send('VKWebAppShowSlidesSheet', {
            slides: [
                {
                    media: {
                        blob: 'data:image/png;base64,',
                        type: 'image'
                    },
                    title: 'Создавайте мероприятия удобнее!',
                    subtitle: 'Обязательно прочти инструкцию! Это важно.'
                },
                {
                    media: {
                        blob: 'data:image/png;base64,',
                        type: 'image'
                    },
                    title: 'Создание',
                    subtitle: 'Заполните всю необходимую информацию о мероприятии и нажмите на кнопку'
                },
                {
                    media: {
                        blob: 'data:image/png;base64,',
                        type: 'image'
                    },
                    title: 'Мероприятие создано',
                    subtitle: 'После нажатия на кнопку Ваше мероприятие появляется в списке'
                },
                {
                    media: {
                        blob: 'data:image/png;base64,',
                        type: 'image'
                    },
                    title: 'Поделись с участниками',
                    subtitle: 'При нажатии на мероприятие появляется QR-код, который вы должны показать участникам, чтобы им начислились баллы'
                },
            ]
        })
            .then(showSlidesData => {
                if (showSlidesData.result && showSlidesData.action === 'confirm') {
                    // Пользователь просмотрел все слайды
                    // Сохраняем в хранилище информацию о том, что пользователь просмотрел слайды
                    bridge.send('VKWebAppStorageSet', { key: 'userViewedSlides', value: 'true' });
                }
            })
            .catch(error => {
                // Обработка ошибок при показе слайдов
                console.error(error);
            });
                    }
                }
            })
            .catch(error => {
                // Обработка ошибок при получении данных из хранилища
                console.error(error);
            });

    }, []);

    useEffect(() => {
        async function fetchData() {
            const user = await bridge.send('VKWebAppGetUserInfo');
            setUser(user);
            setPopout(null);
        }

        fetchData();


    }, []);

    const go = e => {
        setActivePanel(e.currentTarget.dataset.to);
    };

    const handlModalClick = (eventId) => {
    };

    return (
        <ConfigProvider>
            <AdaptivityProvider>
                <AppRoot>
                    <SplitLayout popout={popout}>
                        <SplitCol>
                            <View activePanel={activePanel}>
                                <Home id='home' fetchedUser={fetchedUser} go={go}/>
                                <MyEvent id='myevent' go={go} handlModalClick={handlModalClick}/>
                            </View>
                        </SplitCol>
                    </SplitLayout>
                </AppRoot>
            </AdaptivityProvider>
        </ConfigProvider>
    );
}

export default App;
